const INITIAL_STATE = {
    preguntasT: [
        {
            'id': 1,
            'texto': 'texto pregunta trivia 1'
        },
        {
            'id': 2,
            'texto': 'texto pregunta trivia 2'
        },
        {
            'id': 3,
            'texto': 'texto pregunta trivia 3'
        },
        {
            'id': 4,
            'texto': 'texto pregunta trivia 4'
        },
    ],
    lastId: 4
};

export default (state = INITIAL_STATE, action) => {
    switch (action.type) {
        case 'traer_preguntasT':
            return { ...state, preguntasT: action.payload }
        case 'crear_preguntaT':
            return {
                ...state,
                preguntasT: action.payload
            }
        case 'editar_preguntaT':
            return {
                ...state,
                preguntasT: action.payload
            }
        case 'eliminar_preguntaT':
            return {
                ...state,
                preguntasT: action.payload
            }
        default:
            return state;
    }
}
